export class AlloyAstReflection extends AbstractAstReflection {

    getAllTypes(): string[] {
        return [AdditionalSig, AlloyModule, ArrowExpr, ArrowOp, AssertDecl, AtExpr, BiImplicationExpr, BinaryTemporalExpr, Block, BlockOrBar, BlockStatement, BoxJoinExpr, CardinalityExpr, CmdDecl, ComparisonExpr, ConjunctionExpr, Const, Decl, DisjunctionExpr, DotJoinExpr, EnumDecl, Expr, FactDecl, FieldDecl, FunDecl, ImplicationExpr, Import, IntersectionExpr, LetDecl, LetExpr, MacroDecl, MetaExpr, ModuleDecl, ModuleParam, ModulePath, NamedElement, OverrideExpr, ParaDecls, Paragraph, ParenExpr, PredDecl, PrimeExpr, QualDeclName, QualName, QuantExpr, RestrictionExpr, Scope, SequenceExpr, SetExpr, SigDecl, SigExt, SumExpr, ThisExpr, TypeScope, UnaryExpr, UnaryLogicalExpr, UnaryMultExpr, UnionDiffExpr];
    }

    protected override computeIsSubtype(subtype: string, supertype: string): boolean {
        switch (subtype) {
            case AdditionalSig:
            case Decl:
            case FieldDecl:
            case LetDecl:
            case ModuleParam: {
                return this.isSubtype(NamedElement, supertype);
            }
            case ArrowExpr:
            case AtExpr:
            case BiImplicationExpr:
            case BinaryTemporalExpr:
            case Block:
            case BoxJoinExpr:
            case CardinalityExpr:
            case ComparisonExpr:
            case ConjunctionExpr:
            case Const:
            case DisjunctionExpr:
            case DotJoinExpr:
            case ImplicationExpr:
            case IntersectionExpr:
            case LetExpr:
            case MetaExpr:
            case OverrideExpr:
            case ParenExpr:
            case PrimeExpr:
            case QualName:
            case QuantExpr:
            case RestrictionExpr:
            case SequenceExpr:
            case SetExpr:
            case SumExpr:
            case ThisExpr:
            case UnaryExpr:
            case UnaryLogicalExpr:
            case UnaryMultExpr:
            case UnionDiffExpr: {
                return this.isSubtype(Expr, supertype);
            }
            case AssertDecl:
            case EnumDecl:
            case FactDecl:
            case FunDecl:
            case MacroDecl:
            case PredDecl:
            case SigDecl: {
                return this.isSubtype(NamedElement, supertype) || this.isSubtype(Paragraph, supertype);
            }
            case CmdDecl: {
                return this.isSubtype(Paragraph, supertype);
            }
            case ModuleDecl: {
                return this.isSubtype(AlloyModule, supertype);
            }
            default: {
                return false;
            }
        }
    }

    getReferenceType(refInfo: ReferenceInfo): string {
        const referenceId = `${refInfo.container.$type}:${refInfo.property}`;
        switch (referenceId) {
            case 'AtExpr:ref':
            case 'QualName:ID': {
                return NamedElement;
            }
            default: {
                throw new Error(`${referenceId} is not a valid reference id.`);
            }
        }
    }

    getTypeMetaData(type: string): TypeMetaData {
        switch (type) {
            case AdditionalSig: {
                return {
                    name: AdditionalSig,
                    properties: [
                        { name: 'name' }
                    ]
                };
            }
            case AlloyModule: {
                return {
                    name: AlloyModule,
                    properties: [
                        { name: 'import', defaultValue: [] },
                        { name: 'paragraph', defaultValue: [] }
                    ]
                };
            }
            case ArrowExpr: {
                return {
                    name: ArrowExpr,
                    properties: [
                        { name: 'arrows', defaultValue: [] },
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case ArrowOp: {
                return {
                    name: ArrowOp,
                    properties: [
                        { name: 'leftMult' },
                        { name: 'leftSet' },
                        { name: 'rightMult' },
                        { name: 'rightSet' }
                    ]
                };
            }
            case AssertDecl: {
                return {
                    name: AssertDecl,
                    properties: [
                        { name: 'block' },
                        { name: 'name' }
                    ]
                };
            }
            case AtExpr: {
                return {
                    name: AtExpr,
                    properties: [
                        { name: 'ref' }
                    ]
                };
            }
            case BiImplicationExpr: {
                return {
                    name: BiImplicationExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case BinaryTemporalExpr: {
                return {
                    name: BinaryTemporalExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case Block: {
                return {
                    name: Block,
                    properties: [
                        { name: 'statements', defaultValue: [] }
                    ]
                };
            }
            case BlockOrBar: {
                return {
                    name: BlockOrBar,
                    properties: [
                        { name: 'block' },
                        { name: 'expr' }
                    ]
                };
            }
            case BlockStatement: {
                return {
                    name: BlockStatement,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case BoxJoinExpr: {
                return {
                    name: BoxJoinExpr,
                    properties: [
                        { name: 'indices', defaultValue: [] },
                        { name: 'left' }
                    ]
                };
            }
            case CardinalityExpr: {
                return {
                    name: CardinalityExpr,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case CmdDecl: {
                return {
                    name: CmdDecl,
                    properties: [
                        { name: 'block' },
                        { name: 'chainedCmd' },
                        { name: 'expectNum' },
                        { name: 'kind' },
                        { name: 'name' },
                        { name: 'predicate' },
                        { name: 'scope' }
                    ]
                };
            }
            case ComparisonExpr: {
                return {
                    name: ComparisonExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'negated' },
                        { name: 'op' },
                        { name: 'right' }
                    ]
                };
            }
            case ConjunctionExpr: {
                return {
                    name: ConjunctionExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case Const: {
                return {
                    name: Const,
                    properties: [
                        { name: 'number' }
                    ]
                };
            }
            case Decl: {
                return {
                    name: Decl,
                    properties: [
                        { name: 'additionalNames', defaultValue: [] },
                        { name: 'expr' },
                        { name: 'name' }
                    ]
                };
            }
            case DisjunctionExpr: {
                return {
                    name: DisjunctionExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case DotJoinExpr: {
                return {
                    name: DotJoinExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case EnumDecl: {
                return {
                    name: EnumDecl,
                    properties: [
                        { name: 'name' },
                        { name: 'values', defaultValue: [] }
                    ]
                };
            }
            case FactDecl: {
                return {
                    name: FactDecl,
                    properties: [
                        { name: 'block' },
                        { name: 'name' }
                    ]
                };
            }
            case FieldDecl: {
                return {
                    name: FieldDecl,
                    properties: [
                        { name: 'decl' }
                    ]
                };
            }
            case FunDecl: {
                return {
                    name: FunDecl,
                    properties: [
                        { name: 'body' },
                        { name: 'first' },
                        { name: 'mult' },
                        { name: 'name' },
                        { name: 'paraDecls' },
                        { name: 'qualifier' },
                        { name: 'retType' },
                        { name: 'second' }
                    ]
                };
            }
            case ImplicationExpr: {
                return {
                    name: ImplicationExpr,
                    properties: [
                        { name: 'elseExpr' },
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case Import: {
                return {
                    name: Import,
                    properties: [
                        { name: 'alias' },
                        { name: 'aliases', defaultValue: [] },
                        { name: 'qualName' }
                    ]
                };
            }
            case IntersectionExpr: {
                return {
                    name: IntersectionExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case LetDecl: {
                return {
                    name: LetDecl,
                    properties: [
                        { name: 'expr' },
                        { name: 'name' }
                    ]
                };
            }
            case LetExpr: {
                return {
                    name: LetExpr,
                    properties: [
                        { name: 'blockOrBar' },
                        { name: 'decls', defaultValue: [] }
                    ]
                };
            }
            case MacroDecl: {
                return {
                    name: MacroDecl,
                    properties: [
                        { name: 'expr' },
                        { name: 'name' },
                        { name: 'params', defaultValue: [] }
                    ]
                };
            }
            case MetaExpr: {
                return {
                    name: MetaExpr,
                    properties: [
                        { name: 'qualName' }
                    ]
                };
            }
            case ModuleParam: {
                return {
                    name: ModuleParam,
                    properties: [
                        { name: 'exactly', defaultValue: false },
                        { name: 'name' }
                    ]
                };
            }
            case ModulePath: {
                return {
                    name: ModulePath,
                    properties: [
                        { name: 'name' },
                        { name: 'names', defaultValue: [] }
                    ]
                };
            }
            case OverrideExpr: {
                return {
                    name: OverrideExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case ParaDecls: {
                return {
                    name: ParaDecls,
                    properties: [
                        { name: 'decls', defaultValue: [] }
                    ]
                };
            }
            case ParenExpr: {
                return {
                    name: ParenExpr,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case PredDecl: {
                return {
                    name: PredDecl,
                    properties: [
                        { name: 'block' },
                        { name: 'name' },
                        { name: 'paraDecls' },
                        { name: 'qualifier' }
                    ]
                };
            }
            case PrimeExpr: {
                return {
                    name: PrimeExpr,
                    properties: [
                        { name: 'left' }
                    ]
                };
            }
            case QualDeclName: {
                return {
                    name: QualDeclName,
                    properties: [
                        { name: 'name' },
                        { name: 'names', defaultValue: [] }
                    ]
                };
            }
            case QualName: {
                return {
                    name: QualName,
                    properties: [
                        { name: 'ID' },
                        { name: 'names', defaultValue: [] }
                    ]
                };
            }
            case QuantExpr: {
                return {
                    name: QuantExpr,
                    properties: [
                        { name: 'blockOrBar' },
                        { name: 'decls', defaultValue: [] }
                    ]
                };
            }
            case RestrictionExpr: {
                return {
                    name: RestrictionExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case Scope: {
                return {
                    name: Scope,
                    properties: [
                        { name: 'number' },
                        { name: 'typeScopes', defaultValue: [] }
                    ]
                };
            }
            case SequenceExpr: {
                return {
                    name: SequenceExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case SetExpr: {
                return {
                    name: SetExpr,
                    properties: [
                        { name: 'blockOrBar' },
                        { name: 'decls', defaultValue: [] }
                    ]
                };
            }
            case SigDecl: {
                return {
                    name: SigDecl,
                    properties: [
                        { name: 'additionalSigs', defaultValue: [] },
                        { name: 'block' },
                        { name: 'fields', defaultValue: [] },
                        { name: 'mult' },
                        { name: 'name' },
                        { name: 'sigExt' }
                    ]
                };
            }
            case SigExt: {
                return {
                    name: SigExt,
                    properties: [
                        { name: 'additionalParents', defaultValue: [] },
                        { name: 'keyword' },
                        { name: 'parent' }
                    ]
                };
            }
            case SumExpr: {
                return {
                    name: SumExpr,
                    properties: [
                        { name: 'decls', defaultValue: [] },
                        { name: 'expr' }
                    ]
                };
            }
            case TypeScope: {
                return {
                    name: TypeScope,
                    properties: [
                        { name: 'builtin' },
                        { name: 'endNumber' },
                        { name: 'number' },
                        { name: 'stepNumber' },
                        { name: 'type' }
                    ]
                };
            }
            case UnaryExpr: {
                return {
                    name: UnaryExpr,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case UnaryLogicalExpr: {
                return {
                    name: UnaryLogicalExpr,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case UnaryMultExpr: {
                return {
                    name: UnaryMultExpr,
                    properties: [
                        { name: 'expr' }
                    ]
                };
            }
            case UnionDiffExpr: {
                return {
                    name: UnionDiffExpr,
                    properties: [
                        { name: 'left' },
                        { name: 'right' }
                    ]
                };
            }
            case ModuleDecl: {
                return {
                    name: ModuleDecl,
                    properties: [
                        { name: 'import', defaultValue: [] },
                        { name: 'paragraph', defaultValue: [] },
                        { name: 'params', defaultValue: [] },
                        { name: 'qualName' }
                    ]
                };
            }
            default: {
                return {
                    name: type,
                    properties: []
                };
            }
        }
    }
}

export const reflection = new AlloyAstReflection();
